import React from 'react'; // Asegúrate de que esta línea esté presente solo una vez
import './Card.css'; // Importa los estilos de la tarjeta

function Card({ title, content }) {
  return (
    <div className="card">
      <h2>{title}</h2>
      <p>{content}</p>
    </div>
  );
}

export default Card;
